import React from 'react';
import Flashcard from '../Flashcard/Flashcard';

const CardList = ({ flashcards }) => {
	return (
		<div className="card-container">
			{flashcards.map((card) => {
				return (
					<Flashcard card={card} key={card.id} />
				)
			})}
		</div>
	);
}

export default CardList;
